import Cell from '../lib'

const COLORS = ['red', 'yellow', 'cyan']
for (let i = 0; i < 3; i++) {
  const rand = Math.floor(Math.random() * COLORS.length)
  const config = {
    length: 10,
    backgroundColor: COLORS[rand],
    content: `hello ${Math.random()}`,
  }
  const cell = new Cell(config)
  cell.write()
}
